    <script>
        $(""#like"").click(function (e) {
            e.preventDefault();
            let id = $(this).data(""id"");
            if ($(this).hasClass(""liked"")) {
                $.post(""/admin/projects/unlike?id="" + id, {}, function () {
                    console.log(""unlike"");
                    $(""#like"").removeClass(""liked"");
                    $(""#likesCount"").text(parseInt($(""#likesCount"").text()) - 1)
                });
            }
            else {
                $.post(""/admin/projects/like?id="" + id, {}, function () {
                    console.log(""like"");
                    $(""#like"").addClass(""liked"");
                    $(""#likesCount"").text(parseInt($(""#likesCount"").text()) + 1)
                });
            }
        });
    </script>
